import styled from "styled-components";

const About = () => {
  return (
    <>
      <Container>
        <div
          style={{
            color: "aliceblue",
            width: "1000px",
            fontSize: "100px",
            textAlign: "center",
            padding: "16px",
          }}
        >
          About me
        </div>
        <img src={require("../assets/photos/sideline.png")}></img>
        <div></div>
      </Container>
    </>
  );
};

export default About;

const Container = styled.div`
  border: 5px solid skyblue;
  border-radius: 50px;
  display: flex;
  justify-content: space-between;
  max-width: 50%;
`;
